import React from 'react';
import tiktokIcon from '../assets/tiktok.png';
import instagramIcon from '../assets/instagram.png';

const SocialButtons = ({ isHovered }) => {
  const iconStyle = isHovered ? { filter: 'invert(1)', opacity: 0.75 } : { opacity: 0.75 };

  return (
    <div className="flex space-x-4 mt-5">
      <a href="https://tiktok.com" target="_blank" rel="noopener noreferrer" className="transition-transform duration-300 ease-in-out transform hover:scale-105">
        <img src={tiktokIcon} alt="TikTok" className="h-8 w-8" style={iconStyle} />
      </a>
      <a href="https://instagram.com" target="_blank" rel="noopener noreferrer" className="transition-transform duration-300 ease-in-out transform hover:scale-105">
        <img src={instagramIcon} alt="Instagram" className="h-8 w-8" style={iconStyle} />
      </a>
    </div>
  );
};

export default SocialButtons;
